import React, { Component } from 'react';
import './Homepage.css';
// import './../img/NBA logo';

class Homepage extends Component {
    render() {
        return (
            <div>
                <h2>FUN - SPORT WEBSITE</h2>
                <div className='homepage-link'>
                    <a href="#">Sign up</a>
                    <a href="#">Log in</a>
                    <a href="#">Guest</a>
                </div>
                <div className=''>
                    <img src='./../img/NBA logo'></img>
                </div>

            </div>
        );
    }
}

export default Homepage;
